import React from 'react';
import Typist from 'react-typist';
import Typed from 'react-typed';
const Header = () => {
  return (
    <div className='header-wrap'>
      <div className='main_text'>
        <Typist>
          <h3 className='typis_hello'>Hello Folks! I'm</h3>
          <br />
          <h1 className='typist_name'>Krishna Sai Surendra Babu Kalluri</h1>
          <br />

          <h3 className='typist_job'>
              <Typed
              strings={[" Front End Developer, Working with React, React-Native, Node and other."]}/>

          </h3>
          <Typist.Backspace count={1} delay={10} />
        </Typist>
      </div>
    </div>
  );
};

export default Header;
